import React from 'react';

const header = ()=>{
    return (
    <ul class="nav nav-underline">
    <li class="nav-item">
      <a class="nav-link active" aria-current="page" href="/Location/home">Home</a>
    </li>
    <a href="/admin/login"><button>Logout</button></a>
   
    </ul>)

}

export default header;
